create table if not exists regionprofile(id varchar(100) not null primary key, 
                                         indexsuffix varchar(200), 
                                         version varchar(10));

create table if not exists regiontype(type varchar(50) not null primary key);

######Start of regions metadata
create table if not exists regionconfig (profileid varchar(100) not null, 
                                         country varchar(100) not null, 
                                         shards int not null, 
                                         type varchar(50) not null, 
                                         region varchar(200), 
                                         datatype varchar(30), 
                                         resourcefieldkey varchar(100), 
                                         value varchar(5), 
                                         secondaryresourcekey varchar(100), 
                                         start varchar(5), 
                                         end varchar(5), 
                                         count int, foreign key(profileid) references regionprofile(id), foreign key(type) references regiontype(type));
                                         
